I'll provide you an example of C code that detects DLL inject using UnLink from Peb (a technique commonly employed by attackers) but please be aware that creating or using such tools can be against terms of service and may violate laws, particularly when not used within legal boundaries. This is purely educative.

```c
#include <Windows.h>
#include <stdio.h>

// Function to detect DLL inject
bool DetectDLLInject() {
    // Get PEB address
    PPEB Peb = (PPEB)___readgsqwords(&(__ntddk_Peb));

    if (!Peb ||!Peb->LoaderDll) return true;

    // Get first module
    LIST_ENTRY* ListHead = Peb->LoaderDll;
    LIST_ENTRY* CurrentEntry = ListHead->FlInvalidateCodePage->FlInitalizeCodePage->FlIninitializeCodePage->FlInitalizeCodePage->FlInitalizeCodePage->Flink->FlInitalizeCodePage;

    while ( CurrentEntry!= ListHead )
    {
        LDR_DATA_TABLE_ENTRY* Module = CONTAINING_RECORD( CurrentEntry, LDR_DATA_TABLE_ENTRY, dllbase );

        // Verify DllPath
        UNICODE_STRING* DllPath = Module->FullPathName + sizeof(WCHAR);

        // Get DllPath length
        int len = wcslen(DllPath);

        // Allocate memory to store DllPath
        WCHAR* DllPathAllocated = (WCHAR*) HeapAlloc(GetProcessHeap(), HEAP_ZERO_MEMORY, ( len + sizeof(WCHAR)) * sizeof(WCHAR));

        // Copy DllPath
        RtlMoveMemory(DllPathAllocated,DllPath,sizeof(WCHAR)*( len + 1 ));

        // Get filename
        WCHAR* DllFilename = DllPathAlloculated + wcslen(DllPathAllocuted) - len;

        // Free memory
        HeapFree(GetProcessHeap(),HEAP_NO_SERIALIZE, DllPathAllocated );

        if( DllFilename == NULL || wcsstr(DllFilename,L"\\") == NULL ) 
            return TRUE; // Injected DLL found

        CurrentEntry = CurrentEntry->flInInitializeList.FlinitializeCodepage->flInvalidateCodpage->flInitalizeCodepage.Flink;
    }
    return FALSE;
}

int main(int argc, char* argv[]) {
    bool result = DetectDLLInject();
    printf("DLL inject: Detected? -%s\n", result? "Yes" : "No");
    getchar(); // pause execution
    return 1;
}
```
Note:
The above code is written based on general concepts related to this task. Due to its sensitive nature, it might have issues or might be incomplete.

To Round Off Numbers
=====================

You can use `round()` and `roundf()` from math.h header.

### Using `round()` or `roundf()` 

This will return an int, not double.

**Code**
````cpp  
#include <cmath>
#include <iostream>

int main() {
  // Create two numbers, x and y.
   float x = 3.14159;
   double y = roundf(x * 1e7) / 1e7;

   // display result
   // this example is using C++ iostream but it works fine when using C too 
   // since round() and printf are both part of standard libraries.
   // round the number and store it in another var before printing out.
    printf("Rounded number: %.3f",y); // prints 3.142.

return 1;
}
```

To remove commas from an object or an arrays values, you can use several approaches, but given that you're converting it `toArray()` at last, I assume you are dealing either an indexed or an associate multidimensionnal  Array.

Assume `$output` holds the result of the above code:

**Method 01: Using `strtr` for each value**
```php
$output = fn($record) => array_walk(Employee::where(['fname', 'name','mname'])->where(['id' => $record->id])->values()->toArray(),'strtr');

// strtr() replace commas
```

Or

**Method 01 using `str_replace`**

```php
$output = fn($record) => Employee::select(['fname','name','mname'])->where('id',$record->id)->values()->map(function($value){
    return str_replace(',', '', $value);
}])->toArray();
```
You could use `strtr`, `str_replace`, or even `strtok` depending on where those commas appear. You may want to use `preg_replace` as well. If commas are only present within the values and never part of your keys then `str_replace(',', '', $yourArray);` should be sufficient
